class Browser:
    def __init__(self, w, h):
        self.w = w
        self.h = h
        self.buffer = [None]
        self.pointer = 0

    def add_page(self, page):
        self.buffer.append(page)
        self.pointer += 1

    def remove_pages(self):
        self.buffer = self.buffer[:self.pointer]

    def click(self, x, y):
        for i in range(self.pointer - 1, -1, -1):
            if self.buffer[i][0][0] <= x <= self.buffer[i][0][1] and self.buffer[i][0][2] <= y <= self.buffer[i][0][3]:
                self.add_page(self.buffer[i][1])
                return
        return

    def back(self):
        if self.pointer > 1:
            self.pointer -= 1

    def forward(self):
        if self.pointer < len(self.buffer):
            self.pointer += 1

    def show(self):
        return self.buffer[self.pointer][0]

def main():
    while True:
        n = int(input())
        if n == 0:
            break
        w, h = map(int, input().split())
        browser = Browser(w, h)
        pages = []
        for _ in range(n):
            name = input().split()[0]
            b = int(input())
            buttons = []
            for _ in range(b):
                x1, y1, x2, y2, link = input().split()
                buttons.append(((int(x1), int(y1), int(x2), int(y2)), link))
            pages.append((name, buttons))
        m = int(input())
        for _ in range(m):
            op = input().split()
            if op[0] == 'click':
                x, y = map(int, op[1:])
                browser.click(x, y)
            elif op[0] == 'back':
                browser.back()
            elif op[0] == 'forward':
                browser.forward()
            elif op[0] == 'show':
                print(pages[browser.pointer - 1][0])

if __name__ == "__main__":
    main()
